import styled, { keyframes } from "styled-components";
import pattern from "../../assets/images/pattern.png";
import debruy from "../../assets/images/debruy.png";
import label1 from "../../assets/images/cover-label-1.png";
import label2 from "../../assets/images/cover-label-2.png";
import shape from "../../assets/images/shape.png";

export const Container = styled.div`
  flex: 1;
  align-items: center;
  justify-content: center;
  align-items: center;
`;

export const Banner = styled.div`
  width: 100%;
  background: #ffbb29;
  display: flex;
  justify-content: center;
  position: relative;
`;

export const Pattern = styled.img.attrs({
  src: pattern,
})`
  width: 100%;
  height: 626px;
  object-fit: cover;
`;

export const Box = styled.div`
  width: 1000px;
  height: 626px;
  position: absolute;
  bottom: 0;
  z-index: 1px;
`;

const entryLeft = keyframes`
  from {
    left: -200px;
    opacity: 0;
  }

  to {
    left: 100px;
    opacity: 1;
  }
`;

export const Debruy = styled.img.attrs({
  src: debruy,
})`
  position: absolute;
  bottom: 0;
  left: 100px;
  z-index: 2px;
  height: 500px;
  object-fit: contain;
  animation: ${entryLeft} 600ms linear;
  animation-delay: 500ms;
  opacity: 0;
  animation-fill-mode: forwards;
`;

const entryLeftLabel1_type1 = keyframes`
  from {
    left: 200px;
    opacity: 0;
  }

  to {
    left: 400px;
    opacity: 1;
  }
`;

const entryLeftLabel1_type2 = keyframes`
  from {
    left: 200px;
    opacity: 0;
  }

  to {
    left: 400px;
    opacity: 1;
  }
`;

export const Label1 = styled.img.attrs({
  src: label1,
})`
  width: 500px;
  object-fit: contain;
  position: absolute;
  top: 150px;
  animation: ${entryLeftLabel1_type1} 600ms linear;
  animation-delay: 800ms;
  opacity: 0;
  animation-fill-mode: forwards;

  @media (min-width: 824px) {
    animation: ${entryLeftLabel1_type1} 600ms linear;
    animation-delay: 800ms;
    opacity: 0;
    animation-fill-mode: forwards;
  }
`;

const entryLeftLabel2 = keyframes`
  from {
    left: 300px;
    opacity: 0;
  }

  to {
    left: 450px;
    opacity: 1;
  }
`;

export const Label2 = styled.img.attrs({
  src: label2,
})`
  width: 544px;
  object-fit: contain;
  position: absolute;
  bottom: 90px;
  animation: ${entryLeftLabel2} 600ms linear;
  animation-delay: 1000ms;
  opacity: 0;
  animation-fill-mode: forwards;
`;

export const Shape = styled.img.attrs({
  src: shape,
})`
  width: 100%;
  object-fit: cover;
`;
